$(document).ready(function(){$(".carousel").slick({autoplay:!1,slidesToShow:4,slidesToScroll:1,prevArrow:$(".prev"),nextArrow:$(".next")}),$("a[href^=#]").on("click",function(o){return o.preventDefault(),$("html, body").animate({scrollTop:$($(this).attr("href")).offset().top},{duration:500,easing:"swing"}),!1})});